import React from 'react';
import Song from './Song';

export const Favorites = (props) => {
    return (
        <div className="favorites">
            <h2>Favorite Songs List</h2>
            {
                props.songs ?
                <div className="fave-songs">
                    {
                        props.songs.filter((song) => {
                            if (song.favorite) {
                                return (
                                    <Song song={song} />
                                )
                            }
                        } )
                    }
                </div>
                : null
            }
        </div>
    )
};
